import React from 'react';

const MandalArtTable = ({aa, ab, ac, ba, bb, bc, ca, cb, cc})=>{
    return(
        <table>
            <tr>
                <td>{aa}</td>
                <td>{ab}</td>
                <td>{ac}</td>
            </tr>
            <tr>
                <td>{ba}</td>
                <td>{bb}</td>
                <td>{bc}</td>
            </tr>
            <tr>
                <td>{ca}</td>
                <td>{cb}</td>
                <td>{cc}</td>
            </tr>
        </table>
    );
};

export default MandalArtTable;
